import React from 'react';
import { Link } from 'react-router-dom';
import {
  Container,
  Typography,
  Button,
  Grid,
  Card,
  CardContent,
  Box,
  Chip,
  Fade
} from '@mui/material';
import {
  MusicNote,
  Event,
  People,
  Star
} from '@mui/icons-material';
import ReviewsCarousel from '../components/ReviewsCarousel';

const Home = () => {
  return (
    <>
      {/* Hero Section with Banner */}
      <Box
        className="relative flex items-center justify-center overflow-hidden"
        sx={{
          height: '100vh',
          minHeight: '800px',
          backgroundImage: 'url(/images/banner.jpg)',
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          backgroundAttachment: 'fixed',
          position: 'relative',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            backgroundColor: 'rgba(0, 0, 0, 0.5)',
            zIndex: 1,
          }
        }}
      >
        <Box
          sx={{
            zIndex: 2,
            position: 'absolute',
            bottom: '20%',
            left: '50%',
            transform: 'translateX(-50%)',
            textAlign: 'center'
          }}
        >
          <Fade in timeout={1000}>
            <Typography
              variant="h3"
              sx={{
                color: '#ffffff',
                fontWeight: 'bold',
                fontSize: { xs: '1.8rem', md: '2.5rem' },
                mb: 4,
                textShadow: '2px 2px 4px rgba(0,0,0,0.7)',
                fontStyle: 'italic',
                letterSpacing: '1px'
              }}
            >
              „Muzica e singura limbă pe care o înțeleg toți."
            </Typography>
          </Fade>
          <Fade in timeout={1500}>
            <Button
              component={Link}
              to="/contact"
              variant="contained"
              size="large"
              sx={{
                backgroundColor: '#ffffff',
                color: '#000000',
                fontWeight: 'bold',
                fontSize: '1.3rem',
                px: 6,
                py: 2,
                borderRadius: '50px',
                textTransform: 'uppercase',
                letterSpacing: '2px',
                boxShadow: '0 10px 30px rgba(0,0,0,0.4)',
                '&:hover': {
                  backgroundColor: '#f0f0f0',
                  transform: 'scale(1.08)',
                  boxShadow: '0 15px 40px rgba(0,0,0,0.5)',
                },
                transition: 'all 0.3s ease'
              }}
            >
              Contactează-mă
            </Button>
          </Fade>
        </Box>
      </Box>

      {/* Services Section with Material-UI Cards */}
      <Box className="py-20 bg-gray-50">
        <Container maxWidth="lg">
          <Typography
            variant="h2"
            className="text-center mb-16 font-bold text-4xl md:text-5xl"
            sx={{ color: '#000000', fontWeight: 'bold' }}
          >
            Servicii Profesionale
          </Typography>

          <Grid container spacing={4}>
            {[
              {
                title: 'Nunți',
                description: 'Muzică de calitate pentru ziua ta specială',
                icon: <Event fontSize="large" />,
                color: '#ff6b6b'
              },
              {
                title: 'Evenimente Private',
                description: 'Atmosfera perfectă pentru orice celebrare',
                icon: <People fontSize="large" />,
                color: '#4ecdc4'
              },
              {
                title: 'Majorat & Botez',
                description: 'Momente de neuitat cu muzica potrivită',
                icon: <MusicNote fontSize="large" />,
                color: '#45b7d1'
              }
            ].map((service, index) => (
              <Grid item xs={12} md={4} key={index}>
                <Fade in timeout={1000 + index * 200}>
                  <Card
                    className="h-full transform hover:scale-105 transition-all duration-300 hover:shadow-2xl"
                    sx={{
                      height: '100%',
                      border: '2px solid #000000',
                      borderRadius: '15px',
                      transition: 'all 0.3s ease',
                      '&:hover': {
                        transform: 'translateY(-10px)',
                        boxShadow: '0 20px 40px rgba(0,0,0,0.1)',
                      }
                    }}
                  >
                    <CardContent className="text-center p-8">
                      <Box
                        className="mb-4 flex justify-center"
                        sx={{ color: service.color }}
                      >
                        {service.icon}
                      </Box>
                      <Typography
                        variant="h5"
                        className="mb-4 font-bold"
                        sx={{ fontWeight: 'bold', color: '#000000' }}
                      >
                        {service.title}
                      </Typography>
                      <Typography
                        variant="body1"
                        className="text-gray-600"
                      >
                        {service.description}
                      </Typography>
                    </CardContent>
                  </Card>
                </Fade>
              </Grid>
            ))}
          </Grid>
        </Container>
      </Box>

      {/* About Preview Section */}
      <Box className="py-20 bg-black text-white">
        <Container maxWidth="lg" className="text-center">
          <Typography
            variant="h2"
            className="mb-8 font-bold text-4xl md:text-5xl"
            sx={{ color: '#ffffff', fontWeight: 'bold' }}
          >
            Despre DJ Suru
          </Typography>

          <Typography
            variant="h6"
            className="mb-8 text-lg md:text-xl max-w-4xl mx-auto leading-relaxed"
            sx={{
              color: '#ffffff',
              lineHeight: 1.8,
              fontWeight: 300
            }}
          >
            Experiență și profesionalism pentru evenimentele tale speciale.
            Îmbinarea perfectă între tehnologie de vârf și pasiunea pentru muzică.
          </Typography>

          <Box className="mb-8 flex justify-center flex-wrap gap-4">
            {['Experiență', 'Profesionalism', 'Tehnologie', 'Pasiune'].map((chip, index) => (
              <Chip
                key={index}
                label={chip}
                variant="outlined"
                className="text-white border-white"
                sx={{
                  color: '#ffffff',
                  borderColor: '#ffffff',
                  fontSize: '1rem',
                  padding: '8px 16px',
                  '&:hover': {
                    backgroundColor: 'rgba(255, 255, 255, 0.1)',
                  }
                }}
              />
            ))}
          </Box>

          <Button
            component={Link}
            to="/despre-mine"
            variant="outlined"
            size="large"
            className="border-white text-white hover:bg-white hover:text-black px-8 py-3 rounded-full"
            sx={{
              borderColor: '#ffffff',
              color: '#ffffff',
              borderWidth: '2px',
              px: 4,
              py: 1.5,
              borderRadius: '50px',
              fontWeight: 'bold',
              textTransform: 'uppercase',
              letterSpacing: '1px',
              '&:hover': {
                backgroundColor: '#ffffff',
                color: '#000000',
              }
            }}
          >
            Află mai multe
          </Button>
        </Container>
      </Box>

      {/* Reviews Carousel Section */}
      <ReviewsCarousel />
    </>
  );
};

export default Home;
